void run(void){
  int n,m;
  scanf("%d%d",&n,&m);
  graph *g=newGraph(n,m);
  while(m--){
    int x,y;
    scanf("%d%d",&x,&y);
    x--;y--;
    addEdge(g,x,y);
  }
  int *dp=(int *)calloc(n,sizeof(int));
  int i;
  for(i=0;i<n;i++) dp[i]=-1;
  int ans=0;
  int *stack=(int *)calloc(2*n,sizeof(int));
  for(i=0;i<n;i++){
    if(dp[i]>=0) continue;
    int top=0;
    stack[top++]=i;
    while(top>0){
      int v=stack[--top];
      if(v>=n){
	v-=n;
	int max=-1;
	for(int p=g->start[v];p!=-1;p=g->next[p]) max=MAX(max,dp[g->vertex[p]]);
	dp[v]=max+1;
      } else {
	stack[top++]=v+n;
	for(int p=g->start[v];p!=-1;p=g->next[p]){
	  int u=g->vertex[p];
	  if(dp[u]<0){
	    stack[top++]=u;
	  }
	}
      }
    }
    ans=MAX(ans,dp[i]);
  }
  printf("%d\n",ans);
}
